import React from 'react'

const Card = ({ children }) => {
    return (
      <div className="bg-white shadow-xl hover:shadow-2xl transition-shadow duration-300 rounded-2xl p-6 w-2/5 max-w-[40%] overflow-hidden m-4">
        {children}
      </div>
    );
  };
  
  const CardLayout = ({ leftContent, rightContent }) => {
    return (
      <div className="flex justify-center items-center min-h-screen bg-gray-100 p-4 space-x-4">
        <Card>
          <div className="overflow-auto max-h-96 max-w-full">
            {leftContent}
          </div>
        </Card>
        <Card>
          <div className="overflow-auto max-h-96 max-w-full">
            {rightContent}
          </div>
        </Card>
      </div>
    );
  };

export default CardLayout
